int XmlEnc_FIXML_AllocGrpElements (OSCTXT* pctxt, 
   FIXML_AllocGrpElements* pvalue, const OSUTF8CHAR* elemName, 
   const OSUTF8CHAR* nsPrefix)
{
   int stat = 0;

   if (0 != elemName) {
      stat = rtXmlEncStartElement (pctxt, elemName, nsPrefix, TRUE);
      if (stat != 0) return LOG_RTERR (pctxt, stat);
   }

   { const OSUTF8CHAR* savedPrefix = nsPrefix;
   nsPrefix = rtXmlNSGetPrefix (pctxt, OSUTF8(
      "http://www.fixprotocol.org/FIXML-4-4"));

   /* encode pty_list */

   { const OSUTF8CHAR* savedPrefix = nsPrefix;
   nsPrefix = rtXmlNSGetPrefix (pctxt, OSUTF8(
      "http://www.fixprotocol.org/FIXML-4-4"));

   { OSRTDListNode* pnode = pvalue->pty_list.head;
   while (0 != pnode) {
      stat = XmlEnc_FIXML_NestedParties_Block_t (pctxt, 
         ((FIXML_NestedParties_Block_t*)pnode->data)
         , OSUTF8("Pty"), nsPrefix);
      if (stat != 0) return LOG_RTERR (pctxt, stat);
      pnode = pnode->next;
   }}
   nsPrefix = savedPrefix;
   }

   /* encode comm */

   if (pvalue->m.commPresent) {
      stat = XmlEnc_FIXML_CommissionData_Block_t (pctxt, &pvalue->comm
         , OSUTF8("Comm"), nsPrefix);
      if (stat != 0) return LOG_RTERR (pctxt, stat);
   }
   /* encode miscFees_list */

   { const OSUTF8CHAR* savedPrefix = nsPrefix;
   nsPrefix = rtXmlNSGetPrefix (pctxt, OSUTF8(
      "http://www.fixprotocol.org/FIXML-4-4"));

   { OSRTDListNode* pnode = pvalue->miscFees_list.head;
   while (0 != pnode) {
      stat = XmlEnc_FIXML_MiscFeesGrp_Block_t (pctxt, 
         ((FIXML_MiscFeesGrp_Block_t*)pnode->data)
         , OSUTF8("MiscFees"), nsPrefix);
      if (stat != 0) return LOG_RTERR (pctxt, stat);
      pnode = pnode->next;
   }}
   nsPrefix = savedPrefix;
   }

   /* encode clrInst_list */

   { const OSUTF8CHAR* savedPrefix = nsPrefix;
   nsPrefix = rtXmlNSGetPrefix (pctxt, OSUTF8(
      "http://www.fixprotocol.org/FIXML-4-4"));

   { OSRTDListNode* pnode = pvalue->clrInst_list.head;
   while (0 != pnode) {
      stat = XmlEnc_FIXML_ClrInstGrp_Block_t (pctxt, 
         ((FIXML_ClrInstGrp_Block_t*)pnode->data)
         , OSUTF8("ClrInst"), nsPrefix);
      if (stat != 0) return LOG_RTERR (pctxt, stat);
      pnode = pnode->next;
   }}
   nsPrefix = savedPrefix;
   }

   /* encode setInstr */

   if (pvalue->m.setInstrPresent) {
      stat = XmlEnc_FIXML_SettlInstructionsData_Block_t (pctxt, &pvalue->
         setInstr, OSUTF8("SetInstr"), nsPrefix);
      if (stat != 0) return LOG_RTERR (pctxt, stat);
   }
   nsPrefix = savedPrefix;
   }

   stat = rtXmlEncEndElement (pctxt, elemName, nsPrefix);
   if (stat != 0) return LOG_RTERR (pctxt, stat);

   return (stat);
}

