   ll = xe_tag_len (pctxt, TM_CTXT|TM_CONS|8, ll2);
   if (ll < 0) return LOG_RTERR (pctxt, ll);
   else { ll1 += ll; ll2 = 0; }

   /* encode trdLeg_list */

   pnode2 = pvalue->trdLeg_list.tail;
   while (0 != pnode2) {
      ll = asn1E_FIXML_TrdInstrmtLegGrp_Block_t (pctxt, ((FIXML_TrdInstrmtLegGrp_Block_t*)pnode2->data), ASN1EXPL);
      if (ll < 0) return LOG_RTERR (pctxt, ll);
      ll2 += ll;

      pnode2 = pnode2->prev;
   }
   ll = xe_tag_len (pctxt, TM_CTXT|TM_CONS|7, ll2);
   if (ll < 0) return LOG_RTERR (pctxt, ll);
   else { ll1 += ll; ll2 = 0; }

   /* encode amt_list */

   pnode2 = pvalue->amt_list.tail;
   while (0 != pnode2) {
      ll = asn1E_FIXML_PositionAmountData_Block_t (pctxt, ((FIXML_PositionAmountData_Block_t*)pnode2->data), ASN1EXPL);
      if (ll < 0) return LOG_RTERR (pctxt, ll);
      ll2 += ll;

      pnode2 = pnode2->prev;
   }
   ll = xe_tag_len (pctxt, TM_CTXT|TM_CONS|6, ll2);
   if (ll < 0) return LOG_RTERR (pctxt, ll);
   else { ll1 += ll; ll2 = 0; }

   /* encode sprdBnchmkCurve */

   if (pvalue->m.sprdBnchmkCurvePresent) {
      ll = xe_tag_len (pctxt, TM_CTXT|TM_CONS|5,
         asn1E_FIXML_SpreadOrBenchmarkCurveData_Block_t (pctxt, &pvalue->sprdBnchmkCurve, ASN1IMPL));
      if (ll < 0) return LOG_RTERR (pctxt, ll);
      ll1 += ll;
   }
   /* encode undly_list */

   pnode2 = pvalue->undly_list.tail;
   while (0 != pnode2) {
      ll = asn1E_FIXML_UndInstrmtGrp_Block_t (pctxt, ((FIXML_UndInstrmtGrp_Block_t*)pnode2->data), ASN1EXPL);
      if (ll < 0) return LOG_RTERR (pctxt, ll);
      ll2 += ll;

      pnode2 = pnode2->prev;
   }
   ll = xe_tag_len (pctxt, TM_CTXT|TM_CONS|4, ll2);
   if (ll < 0) return LOG_RTERR (pctxt, ll);
   else { ll1 += ll; ll2 = 0; }

